{
    return(<div className="counter">
                <div>
                    <button className="decrement" onClick={TotalDecrement(by)}>-{by}</button>
                    <button className="increment" onClick={TotalIncrement(by)}>+{by}</button>
                </div>
          </div>
    )

}
